import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar, Container, Row } from 'react-bootstrap';


function App() {
  return (
    <Container>
      <Row>
        <div className="App">
          <Navbar bg="mmColour" variant="dark" fixed="top" expand="sm"
            collapseOnSelect>
            <Navbar.Brand>
              MarketManager
            </Navbar.Brand>

            <Navbar.Toggle />
            <Navbar.Collapse>
              <Nav>

                <Nav.Link href="#">Home</Nav.Link>
                <Nav.Link href="#">My Account</Nav.Link>
                <Nav.Link href="#">Help</Nav.Link>
              </Nav>
            </Navbar.Collapse>


          </Navbar>
          <div className="content">
            This is content.
          </div>
        </div>
      </Row>

    </Container>

  );
}

export default App;
